import React from 'react';
import Board from './Board';
import './App.css';
import Panel from './Panel';
import TurnIndicator from './TurnIndicator';

class App extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div id="App">
        <Board />
        <TurnIndicator />
        <Panel />
      </div>
    );
  }
}

export default App;
